import React, { useState } from 'react';

import './css/LogIn.css';
import { IonInput, IonText, IonButton, IonLoading } from '@ionic/react';
import { render } from '@testing-library/react';

class LogIn extends React.Component {

    private showLoading: boolean = false;

    private setShowLoading(val: boolean) {
        this.showLoading = val;
    }

    render() {

        return (
            <div id="login-form">
                <div id="Logo"></div>
                <div id="phrase">
                    <IonText>O teu gin√°sio da UMinho...</IonText>
                </div>
            <div id="input-form">
                <br></br>
                <IonInput required type="email" id="email-input" placeholder="E-Mail"></IonInput>
                <br></br>
                <IonInput required type="password" id="pass-input" placeholder="Password">
                </IonInput>
            </div>
            <IonButton expand="block" type="submit" id="login-button" onClick={() => {
                    setShowLoading(true);
                }
            }>
                Log-In
            </IonButton>
                <IonLoading
                    isOpen={showLoading}
                    onDidDismiss={() => setShowLoading(false)}
                    message={'Espere um momento...'}
                    duration={5000}
                />
            </div>
        );
    }
};

export default LogIn;

